import React from 'react';
import Navbar from '../navbar/navbar';

const Detail = () => {
    return (
        <div>
            <Navbar/>
            <div className="col-10 mx-auto">
                <h1>Details</h1>
            </div>
        </div>
    );
}

export default Detail;
